import React, { useState, useEffect } from 'react';
import axios from 'axios';

const App = () => {
  const [data, setData] = useState([]);

  useEffect(() => {
    // Fetch data from Flask backend with a specific state (e.g., 'State1')
    axios.get('http://localhost:5000', { params: { state: 'State1' } })
      .then(response => setData(response.data))
      .catch(error => console.log(error));
  }, []);

  return (
    <div>
      <h1>My App</h1>
      <ul>
        {data.map(item => <li key={item.Crop_Year}>{item.Annual_Rainfall}</li>)}
      </ul>
    </div>
  );
};

export default App;
